#include <stdio.h>
#include <stdlib.h>
#include <limits.h>
#include <stdbool.h>

char* minWindow(char* s, char* t) {
    int left = 0;
    // while left is the left side of the current window.
    // start is the left side of the shortest window.
    int start = 0;
    int targetFreq[128] = {0};
    int targetLength = 0;
    int minWindowLength = INT_MAX;
    // initialize the targetFreq[] and targetLength.
    for (int i = 0; t[i] != '\0'; i++) {
        targetFreq[t[i]]++;
        targetLength++;
    }
    // currentFreq[] is the array to store the frequency of chars
    // in the window from left to right.
    int currentFreq[128] = {0};
    int charFound = 0;
    for (int i = 0; s[i] != '\0'; i++) {
        /**
         * only when s[i] appears in t, then we are concerned.
         * process the right side of the window.
         */
        if (targetFreq[s[i]] > 0) {
            currentFreq[s[i]]++;
            // only when window's required chars less than t.
            if (currentFreq[s[i]] <= targetFreq[s[i]]) {
                charFound++;
            }
            // after processing right side of window, deal with left side of window.
            if (charFound == targetLength) {
                /**
                 * currentFreq[s[left]] == 0 correspond to situation:
                 * window=="abcde", t=="ced", can just move left side to the right without updating currentFreq[]
                 *
                 * currentFreq[s[left]] > targetFreq[s[left]] correspond to situation:
                 * window=="abcda", t=="acd", can move left side to the right and update currentFreq[]
                 */
                while(currentFreq[s[left]] == 0 || currentFreq[s[left]] > targetFreq[s[left]]) {
                    if (currentFreq[s[left]] > targetFreq[s[left]]) {
                        currentFreq[s[left]]--;
                    }
                    left++;
                }
                // update the minWindowLength and start of the window.
                if (minWindowLength > i - left + 1) {
                    start = left;
                    minWindowLength = i - left + 1;
                }
            }
        }
    }
    if (minWindowLength == INT_MAX) {
        char *result = calloc(1, sizeof(char));
        return result;
    }
    char *result = calloc(minWindowLength + 1, sizeof(char));
    memcpy(result, s + start, minWindowLength);
    return result;
}


bool containsAll(int *desiredFreq, int *currentFreq) {
    for (int i = 0; i < 128; i++) {
        if (desiredFreq[i] > currentFreq[i]) {
            return false;
        }
    }
    return true;
}


/**
 * slow version, constantly call containsAll() to check
 * currentFreq[] against desiredFreq[]
 * "Time Limit Exceeded" for the last test case in leetcode.
 */
char* minWindowSlow(char* s, char* t) {
    if (strlen(s) < strlen(t)) {
        char *result = calloc(1, sizeof(char));
        return result;
    }
    int left = 0;
    int right = 0;
    int desiredFreq[128] = {0};
    for (int i = 0; i < strlen(t); i++) {
        desiredFreq[t[i]]++;
    }
    int currentFreq[128] = {0};
    int minLength = strlen(s);
    int pos[2];
    bool found = false;
    while (right <= strlen(s) - 1) {
        while (!containsAll(desiredFreq, currentFreq) && right <= strlen(s) -1) {
            currentFreq[s[right++]]++;
        }
        while (containsAll(desiredFreq, currentFreq)) {
            found = true;
            currentFreq[s[left++]]--;
        }

        //printf("current left = %d, right = %d\n", left - 1, right -1);
        if (minLength >= right - left + 1) {
            pos[0] = left - 1;
            pos[1] = right - 1;
            minLength = right - left + 1;
        }
    }
    if (!found) {
        char *result = calloc(1, sizeof(char));
        return result;
    }
    //printf("current left = %d, right = %d\n", pos[0], pos[1]);
    char *result = calloc(minLength + 1, sizeof(char));
    int i = pos[0];
    int j = 0;
    while (i <= pos[1]) {
        *(result + j) = s[i];
        i++;
        j++;
    }
    return result;
}


int main() {
    char *s = "";
    char *t = "";
    char *result = minWindowSlow(s, t);
    printf("result is %s", result);
    free(result);
}
